import React from 'react'
import { Container, Nav, Navbar } from 'react-bootstrap';
import styled from 'styled-components';
import WelcomeBG from '../assets/welcome-background.png';

import { Link } from 'react-scroll';

const Styles = styled.div`
  @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300&display=swap');

  #welcome-container {
    background: url(${WelcomeBG}) no-repeat fixed bottom;
    background-size: cover;
    height: 100vh;
    width: 100vw;
    max-width: None;
    z-index: -1;
  }

  .big {
    font-family: "Raleway", sans-serif;
    font-size: 20vw;
    color: white;
    font-weight: 500;
    z-index: 1;
  }

  .right {
    text-align: right;
  }

  .transparent {
    background-color: None;
    color: white;
    font-family: "Raleway", sans-serif;
  }

  #arrow {
    position: fixed;
    bottom: 0px;
  }
`;

export const Home = () => (
  <Styles>
    <Container id="welcome-container">
      <Navbar className="transparent" variant="dark">
        <Navbar.Brand href="#">EJM</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link>
            <Link activeClass="active" to="about" spy={true} smooth={true} offset={50} duration={1000}>
              About
            </Link>
          </Nav.Link>
          <Nav.Link href="#">Experiences</Nav.Link>
          <Nav.Link href="#">Contact</Nav.Link>
        </Nav>
      </Navbar>
      <p className="big">
      Ethan
      </p>
      <p className="big">
      Maltes
      </p>
    </Container>
  </Styles>
)
